import React, { Component, useState, useEffect } from 'react';

const LogView = (props) =>{
    const [log, setLog] = useState({})
    const getLog = ()=>{
        fetch(`http://localhost:3000/log/${props.id}`)
        .then((log)=>{
            if (response.status === 200) return log.json();
        throw new Error("failed to authenticate user");
        })
        .then(log =>{
            setLog(log)
        })
    }
    useEffect = ()=>{
        getLog()
    }

    return (
        <div>

               <p style={{
                position: 'absolute',
                padding: '1px 10px',
                // height:'25px',
                lineHeight: '25px',
                borderRadius: '50%',
                backgroundColor: 'white',
                color: 'black',
                bottom: '3%',
                left: '15%',
                textDecoration:'none',
                color:'#4267b2'

              }}>
                  {log.title} 
               </p>

        </div>
    )
}

export default LogView;
